import "./navbar.css"
import React from 'react';


export default function Navbar() {


  function debounce(fn, delay) {
    var timer = null;
    return function() {
      var context = this,
        args = arguments;
      clearTimeout(timer);
      timer = setTimeout(function() {
        fn.apply(context, args);
      }, delay);
    };
  }
  onChange= function (event) {
    event.persist();
    this.delayedCallback(event);
  }

  return (
    <div class="form-group has-success has-feedback">
      <label class="col-sm-2 control-label" for="inputSuccess">Search</label>
      <div class="col-sm-10">
        <input type="text" class="form-control" id="inputSuccess" onChange={this.onChange} />
        <span class="glyphicon glyphicon-ok form-control-feedback"></span>
      </div>
    </div>
  )

}
